　　スーパーGT300クラスでお馴染！ポルシェマイスター「ARK TECK MOTORSPORTS」がプロデュースするコアなアイテム。レースで培ったノウハウを惜しげもなくストリートカーへ。もちろんサーキットスペックであることはいうまでもありません。 <br><br>996カレラ用に開発したGT3後期タイプのサイドスカート。カレラだけでなく、986ボクスターにも装着可能です。●左右セット ●FRPゲルコート仕上げ ●純正取付金具別途必要<br><br>【納期】：こちらの商品はご注文をいただいてから通常10～14日でお届けできますが、通常納期を著しく超える場合は別途ご連絡させて頂きます。ご注文後のキャンセルはできません。予めご了承ください。 <br><br>適合車種：97-04 ポルシェ 996 / 986 ボクスター <br><br>　車検対応品<br><br>ボディパーツ/サイドスポイラー・サイドステップ<tr><td colspan="2">
