「誰よりも速く、そして誰よりも美しく」をコンセプトとして数多くのエアロパーツを創造してきた「ings」。ingsのエアロパーツは、ストリートでの存在感と魅力を引き出しつつ、ベースカーの持つポテンシャルを更に高めることを目的としている。そしてレース活動により鍛えられたノウハウは、そのままストリートへと受け継がれる。 <br><br>●素材：ハイブリッド（ウレタン素材レベルの衝撃耐久性能を実現したFRP新素材） ●納期：2～3週間<br><br> <br><br>対応車種： S13 180SX <br><br>車検対応品<br><br>ボディパーツ/サイドスポイラー・サイドステップ<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
